    -- Funo de interpolao linear para calcular a posio intermediria
    function lerp(start, stop, amount)
        return start + (stop - start) * amount
    end
    
    -- Funo para obter os componentes RGBA da cor
    function getColorComponents(color, alpha)
        local r, g, b = getColorRGB(color)
        return r, g, b, alpha
    end
    
    -- Funo para obter os componentes RGB da cor
    function getColorRGB(color)
        return color and math.floor(color / 256 / 256) % 256, math.floor(color / 256) % 256, color % 256
    end
    
